e_enum_TsColumnType('VARCHAR', Bin) ->
    <<Bin/binary, 0>>;
e_enum_TsColumnType('SINT64', Bin) -> <<Bin/binary, 1>>;
e_enum_TsColumnType('DOUBLE', Bin) -> <<Bin/binary, 2>>;
