      tscoveragereq -> d_msg_tscoveragereq(Bin, TrUserData);
      tscell -> d_msg_tscell(Bin, TrUserData);
      tsdelreq -> d_msg_tsdelreq(Bin, TrUserData);
      tsrow -> d_msg_tsrow(Bin, TrUserData);
      tscolumndescription ->
	  d_msg_tscolumndescription(Bin, TrUserData);
      tsputreq -> d_msg_tsputreq(Bin, TrUserData);
      tsgetreq -> d_msg_tsgetreq(Bin, TrUserData);
      tsdelresp -> d_msg_tsdelresp(Bin, TrUserData);
      tsgetresp -> d_msg_tsgetresp(Bin, TrUserData);
      rpbsetbuckettypereq ->
	  d_msg_rpbsetbuckettypereq(Bin, TrUserData);
      rpbgetbuckettypereq ->
	  d_msg_rpbgetbuckettypereq(Bin, TrUserData);
      tslistkeysreq -> d_msg_tslistkeysreq(Bin, TrUserData);
      rpbgetserverinforesp ->
	  d_msg_rpbgetserverinforesp(Bin, TrUserData);
      rpbsetbucketreq ->
	  d_msg_rpbsetbucketreq(Bin, TrUserData);
      rpbgetbucketreq ->
	  d_msg_rpbgetbucketreq(Bin, TrUserData);
      tscoverageresp -> d_msg_tscoverageresp(Bin, TrUserData);
      tsqueryresp -> d_msg_tsqueryresp(Bin, TrUserData);
      rpbauthreq -> d_msg_rpbauthreq(Bin, TrUserData);
      tsqueryreq -> d_msg_tsqueryreq(Bin, TrUserData);
      rpbgetbucketresp ->
	  d_msg_rpbgetbucketresp(Bin, TrUserData);
      rpberrorresp -> d_msg_rpberrorresp(Bin, TrUserData);
      tslistkeysresp -> d_msg_tslistkeysresp(Bin, TrUserData);
      tsputresp -> d_msg_tsputresp(Bin, TrUserData)
    end.


