d_msg_tsrange(Bin, TrUserData) ->
    dfp_read_field_def_tsrange(Bin, 0, 0,
			       id(undefined, TrUserData),
			       id(undefined, TrUserData),
			       id(undefined, TrUserData),
			       id(undefined, TrUserData),
			       id(undefined, TrUserData),
			       id(undefined, TrUserData), TrUserData).

dfp_read_field_def_tsrange(<<10, Rest/binary>>, Z1, Z2,
			   F1, F2, F3, F4, F5, F6, TrUserData) ->
    d_field_tsrange_field_name(Rest, Z1, Z2, F1, F2, F3, F4,
			       F5, F6, TrUserData);
dfp_read_field_def_tsrange(<<16, Rest/binary>>, Z1, Z2,
			   F1, F2, F3, F4, F5, F6, TrUserData) ->
    d_field_tsrange_lower_bound(Rest, Z1, Z2, F1, F2, F3,
				F4, F5, F6, TrUserData);
dfp_read_field_def_tsrange(<<24, Rest/binary>>, Z1, Z2,
			   F1, F2, F3, F4, F5, F6, TrUserData) ->
    d_field_tsrange_lower_bound_inclusive(Rest, Z1, Z2, F1,
					  F2, F3, F4, F5, F6, TrUserData);
dfp_read_field_def_tsrange(<<32, Rest/binary>>, Z1, Z2,
			   F1, F2, F3, F4, F5, F6, TrUserData) ->
    d_field_tsrange_upper_bound(Rest, Z1, Z2, F1, F2, F3,
				F4, F5, F6, TrUserData);
dfp_read_field_def_tsrange(<<40, Rest/binary>>, Z1, Z2,
			   F1, F2, F3, F4, F5, F6, TrUserData) ->
    d_field_tsrange_upper_bound_inclusive(Rest, Z1, Z2, F1,
					  F2, F3, F4, F5, F6, TrUserData);
dfp_read_field_def_tsrange(<<50, Rest/binary>>, Z1, Z2,
			   F1, F2, F3, F4, F5, F6, TrUserData) ->
    d_field_tsrange_desc(Rest, Z1, Z2, F1, F2, F3, F4, F5,
			 F6, TrUserData);
dfp_read_field_def_tsrange(<<>>, 0, 0, F1, F2, F3, F4,
			   F5, F6, _) ->
    #tsrange{field_name = F1, lower_bound = F2,
	     lower_bound_inclusive = F3, upper_bound = F4,
	     upper_bound_inclusive = F5, desc = F6};
dfp_read_field_def_tsrange(Other, Z1, Z2, F1, F2, F3,
			   F4, F5, F6, TrUserData) ->
    dg_read_field_def_tsrange(Other, Z1, Z2, F1, F2, F3, F4,
			      F5, F6, TrUserData).

dg_read_field_def_tsrange(<<1:1, X:7, Rest/binary>>, N,
			  Acc, F1, F2, F3, F4, F5, F6, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_tsrange(Rest, N + 7, X bsl N + Acc,
			      F1, F2, F3, F4, F5, F6, TrUserData);
dg_read_field_def_tsrange(<<0:1, X:7, Rest/binary>>, N,
			  Acc, F1, F2, F3, F4, F5, F6, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_tsrange_field_name(Rest, 0, 0, F1, F2, F3, F4,
				     F5, F6, TrUserData);
      16 ->
	  d_field_tsrange_lower_bound(Rest, 0, 0, F1, F2, F3, F4,
				      F5, F6, TrUserData);
      24 ->
	  d_field_tsrange_lower_bound_inclusive(Rest, 0, 0, F1,
						F2, F3, F4, F5, F6, TrUserData);
      32 ->
	  d_field_tsrange_upper_bound(Rest, 0, 0, F1, F2, F3, F4,
				      F5, F6, TrUserData);
      40 ->
	  d_field_tsrange_upper_bound_inclusive(Rest, 0, 0, F1,
						F2, F3, F4, F5, F6, TrUserData);
      50 ->
	  d_field_tsrange_desc(Rest, 0, 0, F1, F2, F3, F4, F5, F6,
			       TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_tsrange(Rest, 0, 0, F1, F2, F3, F4, F5, F6,
				    TrUserData);
	    1 ->
		skip_64_tsrange(Rest, 0, 0, F1, F2, F3, F4, F5, F6,
				TrUserData);
	    2 ->
		skip_length_delimited_tsrange(Rest, 0, 0, F1, F2, F3,
					      F4, F5, F6, TrUserData);
	    5 ->
		skip_32_tsrange(Rest, 0, 0, F1, F2, F3, F4, F5, F6,
				TrUserData)
	  end
    end;
dg_read_field_def_tsrange(<<>>, 0, 0, F1, F2, F3, F4,
			  F5, F6, _) ->
    #tsrange{field_name = F1, lower_bound = F2,
	     lower_bound_inclusive = F3, upper_bound = F4,
	     upper_bound_inclusive = F5, desc = F6}.

d_field_tsrange_field_name(<<1:1, X:7, Rest/binary>>, N,
			   Acc, F1, F2, F3, F4, F5, F6, TrUserData)
    when N < 57 ->
    d_field_tsrange_field_name(Rest, N + 7, X bsl N + Acc,
			       F1, F2, F3, F4, F5, F6, TrUserData);
d_field_tsrange_field_name(<<0:1, X:7, Rest/binary>>, N,
			   Acc, _, F2, F3, F4, F5, F6, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_tsrange(Rest2, 0, 0, NewFValue, F2,
			       F3, F4, F5, F6, TrUserData).


d_field_tsrange_lower_bound(<<1:1, X:7, Rest/binary>>,
			    N, Acc, F1, F2, F3, F4, F5, F6, TrUserData)
    when N < 57 ->
    d_field_tsrange_lower_bound(Rest, N + 7, X bsl N + Acc,
				F1, F2, F3, F4, F5, F6, TrUserData);
d_field_tsrange_lower_bound(<<0:1, X:7, Rest/binary>>,
			    N, Acc, F1, _, F3, F4, F5, F6, TrUserData) ->
    ZValue = X bsl N + Acc,
    NewFValue = if ZValue band 1 =:= 0 -> ZValue bsr 1;
		   true -> -(ZValue + 1 bsr 1)
		end,
    dfp_read_field_def_tsrange(Rest, 0, 0, F1, NewFValue,
			       F3, F4, F5, F6, TrUserData).


d_field_tsrange_lower_bound_inclusive(<<1:1, X:7,
					Rest/binary>>,
				      N, Acc, F1, F2, F3, F4, F5, F6,
				      TrUserData)
    when N < 57 ->
    d_field_tsrange_lower_bound_inclusive(Rest, N + 7,
					  X bsl N + Acc, F1, F2, F3, F4, F5, F6,
					  TrUserData);
d_field_tsrange_lower_bound_inclusive(<<0:1, X:7,
					Rest/binary>>,
				      N, Acc, F1, F2, _, F4, F5, F6,
				      TrUserData) ->
    NewFValue = X bsl N + Acc =/= 0,
    dfp_read_field_def_tsrange(Rest, 0, 0, F1, F2,
			       NewFValue, F4, F5, F6, TrUserData).


d_field_tsrange_upper_bound(<<1:1, X:7, Rest/binary>>,
			    N, Acc, F1, F2, F3, F4, F5, F6, TrUserData)
    when N < 57 ->
    d_field_tsrange_upper_bound(Rest, N + 7, X bsl N + Acc,
				F1, F2, F3, F4, F5, F6, TrUserData);
d_field_tsrange_upper_bound(<<0:1, X:7, Rest/binary>>,
			    N, Acc, F1, F2, F3, _, F5, F6, TrUserData) ->
    ZValue = X bsl N + Acc,
    NewFValue = if ZValue band 1 =:= 0 -> ZValue bsr 1;
		   true -> -(ZValue + 1 bsr 1)
		end,
    dfp_read_field_def_tsrange(Rest, 0, 0, F1, F2, F3,
			       NewFValue, F5, F6, TrUserData).


d_field_tsrange_upper_bound_inclusive(<<1:1, X:7,
					Rest/binary>>,
				      N, Acc, F1, F2, F3, F4, F5, F6,
				      TrUserData)
    when N < 57 ->
    d_field_tsrange_upper_bound_inclusive(Rest, N + 7,
					  X bsl N + Acc, F1, F2, F3, F4, F5, F6,
					  TrUserData);
d_field_tsrange_upper_bound_inclusive(<<0:1, X:7,
					Rest/binary>>,
				      N, Acc, F1, F2, F3, F4, _, F6,
				      TrUserData) ->
    NewFValue = X bsl N + Acc =/= 0,
    dfp_read_field_def_tsrange(Rest, 0, 0, F1, F2, F3, F4,
			       NewFValue, F6, TrUserData).


d_field_tsrange_desc(<<1:1, X:7, Rest/binary>>, N, Acc,
		     F1, F2, F3, F4, F5, F6, TrUserData)
    when N < 57 ->
    d_field_tsrange_desc(Rest, N + 7, X bsl N + Acc, F1, F2,
			 F3, F4, F5, F6, TrUserData);
d_field_tsrange_desc(<<0:1, X:7, Rest/binary>>, N, Acc,
		     F1, F2, F3, F4, F5, _, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_tsrange(Rest2, 0, 0, F1, F2, F3, F4,
			       F5, NewFValue, TrUserData).


skip_varint_tsrange(<<1:1, _:7, Rest/binary>>, Z1, Z2,
		    F1, F2, F3, F4, F5, F6, TrUserData) ->
    skip_varint_tsrange(Rest, Z1, Z2, F1, F2, F3, F4, F5,
			F6, TrUserData);
skip_varint_tsrange(<<0:1, _:7, Rest/binary>>, Z1, Z2,
		    F1, F2, F3, F4, F5, F6, TrUserData) ->
    dfp_read_field_def_tsrange(Rest, Z1, Z2, F1, F2, F3, F4,
			       F5, F6, TrUserData).


skip_length_delimited_tsrange(<<1:1, X:7, Rest/binary>>,
			      N, Acc, F1, F2, F3, F4, F5, F6, TrUserData)
    when N < 57 ->
    skip_length_delimited_tsrange(Rest, N + 7,
				  X bsl N + Acc, F1, F2, F3, F4, F5, F6,
				  TrUserData);
skip_length_delimited_tsrange(<<0:1, X:7, Rest/binary>>,
			      N, Acc, F1, F2, F3, F4, F5, F6, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_tsrange(Rest2, 0, 0, F1, F2, F3, F4,
			       F5, F6, TrUserData).


