				      id([], TrUserData),
				      id(undefined, TrUserData), TrUserData).

dfp_read_field_def_tslistkeysresp(<<10, Rest/binary>>,
				  Z1, Z2, F1, F2, TrUserData) ->
    d_field_tslistkeysresp_keys(Rest, Z1, Z2, F1, F2,
				TrUserData);
dfp_read_field_def_tslistkeysresp(<<16, Rest/binary>>,
				  Z1, Z2, F1, F2, TrUserData) ->
    d_field_tslistkeysresp_done(Rest, Z1, Z2, F1, F2,
				TrUserData);
dfp_read_field_def_tslistkeysresp(<<>>, 0, 0, F1, F2,
				  TrUserData) ->
    #tslistkeysresp{keys = lists_reverse(F1, TrUserData),
		    done = F2};
