				  TrUserData) ->
    dg_read_field_def_tslistkeysresp(Other, Z1, Z2, F1, F2,
				     TrUserData).

dg_read_field_def_tslistkeysresp(<<1:1, X:7,
				   Rest/binary>>,
				 N, Acc, F1, F2, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_tslistkeysresp(Rest, N + 7,
				     X bsl N + Acc, F1, F2, TrUserData);
dg_read_field_def_tslistkeysresp(<<0:1, X:7,
				   Rest/binary>>,
				 N, Acc, F1, F2, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_tslistkeysresp_keys(Rest, 0, 0, F1, F2,
				      TrUserData);
      16 ->
	  d_field_tslistkeysresp_done(Rest, 0, 0, F1, F2,
				      TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_tslistkeysresp(Rest, 0, 0, F1, F2,
					   TrUserData);
	    1 ->
		skip_64_tslistkeysresp(Rest, 0, 0, F1, F2, TrUserData);
	    2 ->
		skip_length_delimited_tslistkeysresp(Rest, 0, 0, F1, F2,
