				 TrUserData) ->
    #tslistkeysresp{keys = lists_reverse(F1, TrUserData),
		    done = F2}.

d_field_tslistkeysresp_keys(<<1:1, X:7, Rest/binary>>,
			    N, Acc, F1, F2, TrUserData)
    when N < 57 ->
    d_field_tslistkeysresp_keys(Rest, N + 7, X bsl N + Acc,
				F1, F2, TrUserData);
d_field_tslistkeysresp_keys(<<0:1, X:7, Rest/binary>>,
			    N, Acc, F1, F2, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bs:Len/binary, Rest2/binary>> = Rest,
    NewFValue = id(d_msg_tsrow(Bs, TrUserData), TrUserData),
    dfp_read_field_def_tslistkeysresp(Rest2, 0, 0,
				      cons(NewFValue, F1, TrUserData), F2,
				      TrUserData).


d_field_tslistkeysresp_done(<<1:1, X:7, Rest/binary>>,
			    N, Acc, F1, F2, TrUserData)
    when N < 57 ->
    d_field_tslistkeysresp_done(Rest, N + 7, X bsl N + Acc,
				F1, F2, TrUserData);
d_field_tslistkeysresp_done(<<0:1, X:7, Rest/binary>>,
			    N, Acc, F1, _, TrUserData) ->
    NewFValue = X bsl N + Acc =/= 0,
    dfp_read_field_def_tslistkeysresp(Rest, 0, 0, F1,
				      NewFValue, TrUserData).


