    when element(1, Prev) =:= element(1, New) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Prev of
      #tsrange{} -> merge_msg_tsrange(Prev, New, TrUserData);
      #tscoverageentry{} ->
	  merge_msg_tscoverageentry(Prev, New, TrUserData);
      #rpbmodfun{} ->
	  merge_msg_rpbmodfun(Prev, New, TrUserData);
