	  merge_msg_tscoveragereq(Prev, New, TrUserData);
      #tscell{} -> merge_msg_tscell(Prev, New, TrUserData);
      #tsdelreq{} ->
	  merge_msg_tsdelreq(Prev, New, TrUserData);
      #tsrow{} -> merge_msg_tsrow(Prev, New, TrUserData);
      #tscolumndescription{} ->
	  merge_msg_tscolumndescription(Prev, New, TrUserData);
      #tsputreq{} ->
