      #tsgetresp{} ->
	  merge_msg_tsgetresp(Prev, New, TrUserData);
      #rpbsetbuckettypereq{} ->
	  merge_msg_rpbsetbuckettypereq(Prev, New, TrUserData);
      #rpbgetbuckettypereq{} ->
	  merge_msg_rpbgetbuckettypereq(Prev, New, TrUserData);
      #tslistkeysreq{} ->
	  merge_msg_tslistkeysreq(Prev, New, TrUserData);
