verify_msg(Msg) -> verify_msg(Msg, []).

verify_msg(Msg, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Msg of
      #tsrange{} -> v_msg_tsrange(Msg, [tsrange], TrUserData);
      #tscoverageentry{} ->
	  v_msg_tscoverageentry(Msg, [tscoverageentry],
				TrUserData);
      #rpbmodfun{} ->
	  v_msg_rpbmodfun(Msg, [rpbmodfun], TrUserData);
      #rpbcommithook{} ->
	  v_msg_rpbcommithook(Msg, [rpbcommithook], TrUserData);
      #rpbbucketprops{} ->
	  v_msg_rpbbucketprops(Msg, [rpbbucketprops], TrUserData);
      #rpbpair{} -> v_msg_rpbpair(Msg, [rpbpair], TrUserData);
      #rpbresetbucketreq{} ->
	  v_msg_rpbresetbucketreq(Msg, [rpbresetbucketreq],
				  TrUserData);
      #tsinterpolation{} ->
	  v_msg_tsinterpolation(Msg, [tsinterpolation],
				TrUserData);
      #tscoveragereq{} ->
	  v_msg_tscoveragereq(Msg, [tscoveragereq], TrUserData);
      #tscell{} -> v_msg_tscell(Msg, [tscell], TrUserData);
      #tsdelreq{} ->
	  v_msg_tsdelreq(Msg, [tsdelreq], TrUserData);
      #tsrow{} -> v_msg_tsrow(Msg, [tsrow], TrUserData);
      #tscolumndescription{} ->
	  v_msg_tscolumndescription(Msg, [tscolumndescription],
				    TrUserData);
      #tsputreq{} ->
	  v_msg_tsputreq(Msg, [tsputreq], TrUserData);
      #tsgetreq{} ->
	  v_msg_tsgetreq(Msg, [tsgetreq], TrUserData);
      #tsdelresp{} ->
	  v_msg_tsdelresp(Msg, [tsdelresp], TrUserData);
      #tsgetresp{} ->
	  v_msg_tsgetresp(Msg, [tsgetresp], TrUserData);
      #rpbsetbuckettypereq{} ->
	  v_msg_rpbsetbuckettypereq(Msg, [rpbsetbuckettypereq],
				    TrUserData);
      #rpbgetbuckettypereq{} ->
	  v_msg_rpbgetbuckettypereq(Msg, [rpbgetbuckettypereq],
				    TrUserData);
      #tslistkeysreq{} ->
	  v_msg_tslistkeysreq(Msg, [tslistkeysreq], TrUserData);
      #rpbgetserverinforesp{} ->
	  v_msg_rpbgetserverinforesp(Msg, [rpbgetserverinforesp],
				     TrUserData);
      #rpbsetbucketreq{} ->
	  v_msg_rpbsetbucketreq(Msg, [rpbsetbucketreq],
				TrUserData);
      #rpbgetbucketreq{} ->
	  v_msg_rpbgetbucketreq(Msg, [rpbgetbucketreq],
				TrUserData);
      #tscoverageresp{} ->
	  v_msg_tscoverageresp(Msg, [tscoverageresp], TrUserData);
      #tsqueryresp{} ->
	  v_msg_tsqueryresp(Msg, [tsqueryresp], TrUserData);
      #rpbauthreq{} ->
	  v_msg_rpbauthreq(Msg, [rpbauthreq], TrUserData);
      #tsqueryreq{} ->
	  v_msg_tsqueryreq(Msg, [tsqueryreq], TrUserData);
      #rpbgetbucketresp{} ->
	  v_msg_rpbgetbucketresp(Msg, [rpbgetbucketresp],
				 TrUserData);
      #rpberrorresp{} ->
	  v_msg_rpberrorresp(Msg, [rpberrorresp], TrUserData);
      #tslistkeysresp{} ->
	  v_msg_tslistkeysresp(Msg, [tslistkeysresp], TrUserData);
      #tsputresp{} ->
	  v_msg_tsputresp(Msg, [tsputresp], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


