       true -> v_type_bool(F2, [allow_mult | Path])
    end,
    if F3 == undefined -> ok;
       true -> v_type_bool(F3, [last_write_wins | Path])
    end,
    if is_list(F4) ->
	   _ = [v_msg_rpbcommithook(Elem, [precommit | Path],
				    TrUserData)
		|| Elem <- F4],
