				    TrUserData)
		|| Elem <- F6],
	   ok;
       true ->
	   mk_type_error({invalid_list_of, {msg, rpbcommithook}},
			 F6, Path)
    end,
    if F7 == undefined -> ok;
       true -> v_type_bool(F7, [has_postcommit | Path])
