    end,
    if F17 == undefined -> ok;
       true -> v_type_uint32(F17, [pw | Path])
    end,
    if F18 == undefined -> ok;
       true -> v_type_uint32(F18, [dw | Path])
    end,
    if F19 == undefined -> ok;
       true -> v_type_uint32(F19, [rw | Path])
    end,
    if F20 == undefined -> ok;
